function fire() {
    if (!atk_preffered) {
		arr = connectable_array($data._char[0], excluding);
        if ($data.mission != null) {
            arr = arr.sort(M_WORDSORTER);
        } else {
            arr = arr.sort(I_WORDSORTER);
        }
    } else {
		if (oneatk__) {
			arr = mkarr($data._char[0]);
			arr = arr.filter(e => excluding.indexOf(e) == -1);
			arr = arr.filter(function(e) {
				if (deprecated[$data._char[0]])
					return deprecated[$data._char[0]].indexOf(e) == -1;
				return true;
			});
			arr = arr.sort(P_WORDSORTER);
		} else {
			arr = siritori(excluding[excluding.length - 1], 0, excluding); // not implemented yet
			if (arr.length == 0) {
				if (emergency) arr = atk_str[$data._char[0]];
				if (arr == undefined) arr = [];
				if (arr.length == 0) {
					arr = connectable_array($data._char[0], excluding);
					arr = arr.sort(P_WORDSORTER);					
				} else {
					arr = arr.filter((e) => excluding.indexOf(e) == -1);
				}
			} else console.log("FLAG ON");
		}
	}
    if (!(arr.length > 0)) return;
    if (!SPEEDER) {
        tick_timer = setTimeout(function () {
			if (!($data._turnTime <= TICK * 10 || $data._roundTime <= TICK * 10)) {
				send("talk", { value: arr[0], relay: 1 });				
				// categorize_word(arr[0]);
			}
        }, delayCalibration());
    } else {
		send("talk", { value: arr[0], relay: 1 });
		// categorize_word(arr[0]);
	}
    spamCount = 0, spamWarning = 0;
}

