onMessage_hook = function (a) {
	var ret = onMessage_real.apply(this, Array.from(arguments));
    if (a.type == "roundEnd") excluding = [];
    switch (a.type) {
		case "conn":
			readData();
			// sendWhisper(STUDENT, "로그인 중이신가요");
			break;
		case "disconn":
			saveData();
			break;
        case "turnEnd":
			if (room_theme == undefined) {
				clearTimeout(tick_timer);
				if (a.value == null) break;
				if (mkarr(a.value[0]).indexOf(a.value) == -1) {
					if (including[a.value[0]] == null) including[a.value[0]] = [];
					including[a.value[0]].push(a.value);
					// saveData();
					console.log("New word was detected");
				}
				emergency = false;
				if (excluding.indexOf(a.value) == -1) excluding.push(a.value);
			} else {
				// INPUT CODE
				
			}
            break;
        case "turnStart":
			if (room_theme == undefined) {
				if ($data.id == $data._tid) {
					fire();
					roundTime_real = $data._roundTime;
				}
			} else {
				// INPUT CODE
				
			}
            break;
        case "turnError":
			if (room_theme == undefined) {
				if ($data.id == $data._tid) {
					if (deprecated[arr[0][0]] == null) deprecated[arr[0][0]] = [];
					deprecated[arr[0][0]].push(arr[0]);
					// saveData();
					console.log("Deprecated word was used");
					excluding.push(arr[0]);
					emergency ? fire_onEmergency() : fire();
				}
			} else {
				// INPUT CODE
				
			}
            break;
		case "roundReady":
			excluding = [];
			room_theme = a.theme;
			break;
    }
	return ret;
}
