function whereis(nick, inf) {
	if (inf == undefined) inf = "place";
    var arr = Object.getOwnPropertyNames($data.users);
    for (i = 0; i < arr.length; i++) {
        if ($data.users[arr[i]].profile.nick == nick) {
            console.log($data.users[arr[i]].profile.nick + " is detected");
            return $data.users[arr[i]][inf];
        }
    }
    for (i = 0; i < arr.length; i++) {
        if ($data.users[arr[i]].profile.nick.slice(0, nick.length) == nick) {
            console.log($data.users[arr[i]].profile.nick + " is detected");
            return $data.users[arr[i]][inf];
        }
    }
    for (i = 0; i < arr.length; i++) {
        if ($data.users[arr[i]].profile.nick.slice(0, nick.length).toLowerCase() == nick.toLowerCase()) {
            console.log($data.users[arr[i]].profile.nick + " is detected");
            return $data.users[arr[i]][inf];
        }
    }
	for (i = 0; i < arr.length; i++) {
        if (new RegExp(nick, "g").test($data.users[arr[i]].profile.nick)) {
            console.log($data.users[arr[i]].profile.nick + " is detected");
            return $data.users[arr[i]][inf];
        }
    }
	console.log("No one has found");
    return 0;
}

