function connectable_array(word, exc) { // 다음 턴에 나올 수 있는 단어 중 쓸 수 있는 단어만 고른다.
	return mkarr(word[word.length - 1]).filter(function(e) { // 이미 쓴 단어를 배제한다.
		return exc.indexOf(e) == -1;
	}).filter(function(e) {
		if (deprecated[$data._char[0]])
			return deprecated[$data._char[0]].indexOf(e) == -1;
		return true;
	});
}

var CONST_LOGIC_NUMBER = 7; // 이 수는 반드시 홀수가 되어야 함
// 0 -> 예측
// 1 -> 상대방 예측
// 2 -> 나 예측
// 3 -> 리턴;
// Not Completed
function siritori(word, logic_count, exc) {
	if (exc== undefined) exc = [];
	if (logic_count == undefined) logic_count = 0;
	return [];
	// return _siritori(word, logic_count, exc);
}

function _siritori(word, logic_count, exc) {
	var arr = connectable_array(word, exc); // 다음 턴에 나올 수 있는 단어 중 쓸 수 있는 단어만 고른 배열이다.
	if (logic_count % 2 == 0) arr = arr.filter(e => connectable_array(e, exc).length <= 2); // 너무 잇기 쉬운 단어를 배제한다.
	if (logic_count >= CONST_LOGIC_NUMBER) return []; // 더 이상 진행할 수 없으므로 공집합 리턴
	if (arr.length == 0) return [];
	return arr.filter(function(item) {
		return (_siritori(item, logic_count + 1, exc.concat(item)).length != 0) ^ (logic_count % 2 == 0); // 나에게 유리한 단어만 남긴다.
	});
}

function init_atkArr() {
	atk_str = {};
	localStorage['atk_str'] = "{}";
	Object.getOwnPropertyNames(including).concat(Object.getOwnPropertyNames(DB)).filter((item, idx, arr) => arr.indexOf(item) == idx).map(function(e) {
		atk_str[e] = mkarr(e).filter(function(item) {
			return mkarr(item[item.length - 1]).length <= 3;
		}).sort(P_WORDSORTER).filter(function(item) {
			if (deprecated[item[0]])
				return deprecated[item[0]].indexOf(item) == -1;
			return true;
		});
	});
}

